import React from 'react'
import '../index.css'
import HeaderIcon from '../images/HeaderIcon.png'
import '../styles/header.scss'


function Header() {
  return (
    <div className="header">
        <img src={HeaderIcon} alt="" />
    </div>
  )
}

export default Header
